import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import NavBar from './components/NavBar';
import styles from './App.module.css';

function App() {
  return (
    <div className="styles.App">
      <NavBar />
      <header className="App-header">
        <h1>My Gym Share</h1>
      </header>
    </div>
  );
}

export default App;
